  return (
    <>
      <div className="container" style={{paddingTop:"20px"}}>
        <div className="card border border-info shadow-lg" style={{cursor:"pointer",width:"40%"}}>
          <div className="card-body">
            <h5 className="card-title">Event Name</h5>
            <h6 className="card-subtitle mb-2 text-info">Institution's Name</h6>
            <p>Date : 24-03-2023</p>
            <p>Time : 10 AM</p>
            <p>Mode : Online</p>
            <p>Contact No. : 7666536317</p>
            <a className="card-link text-info">View</a>
            <a className="card-link text-info">Register Now</a>
          </div>
        </div>
      </div>
    </>
  );
}

export default EventItem;
